import React from "react";
import { VictoryPie } from "victory";
import './StylePie.css';

const PieChart = () => {
  return (
    <div className="pie-chart">
      <VictoryPie
        style={{ labels: { fill: "white" } }}
        innerRadius={100}
        colorScale="blue"
        data={[
          { x:"IOS", y:80 },
          { x:"Android",y:20 }
        ]}
      />
    </div>
  );
};
export default PieChart;
